“Sin Cargo de Conciencia”, nuevo adelanto del EP Si Fuera Mía, es la reunión de la legendaria pluma de Leonel García con el extraordinario talento vocal de Carlos Rivera. Un nuevo track ya disponible en audio y video que se suma al flamante proyecto a voz y guitarra del hijo pródigo de Huamantla.⁠
⁠
Tras brillantes lanzamientos que nos demuestran que con talento y corazón es más que suficiente para tocar las fibras más sensibles, Carlos Rivera nos trae esta nueva reinterpretación acústica de una de las composiciones que a su consideración representan lo mejor de la canción contemporánea. La elegida en esta ocasión fue “Sin Cargo de Conciencia” tema que abriera el álbum del 2008, L.P. producción con la que García daba inicio a su etapa solista a través de su alter ego, León Polar.⁠
